import "chart.js/auto";
import { Bar } from "react-chartjs-2";
import React, { Component } from "react";

class BarChart extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: {
        labels: [
          "NumberOfBedrooms",
          "NumberOfBathrooms",
          "TaxAmount",
          "Area",
          "YearBuilt",
        ],
        datasets: [
          {
            label: "User Input",
            data: [1, 2, 3, 4, 5],
            backgroundColor: [
              "rgba(255, 99, 132, 0.6)",
              "rgba(54, 162, 235, 0.6)",
              "rgba(255, 206, 86, 0.6)",
              "rgba(75, 192, 192, 0.6)",
              "rgba(153, 102, 255, 0.6)",
            ],
          },
        ],
      },
    };
  }

  render() {
    return (
      <Bar data={this.state.data} options={{ maintainAspectRatio: true }} />
    );
  }
}

export default BarChart;
